/**
 * 封装: public、protect、private
 *      - public: 本类、子类、其他类 可访问
 *      - protect: 本类、子类       可访问
 *      - private: 本类            可访问
 * super() 等效 parentClass.call(this)
 * readonly 只读属性-只能父类constructor内能修改
 * get/set方法 - 添加直接读取的属性, 场景: 访问私有属性
 */
declare const _default: {};
export default _default;
